import React, {useState,useEffect} from 'react';
import Loader from '../assets/loderr.gif';


 function Home(){
    const [data,setData]=useState([]);
    const [isLoading,setIsLoading]=useState(false);

    useEffect(()=> {
      setIsLoading(true);
      setTimeout (async()=>
      {
        try{
             const jsonData = await fetch("https://jsonplaceholder.typicode.com/todos");
             const data = await jsonData.json();
             setData(data);
             setIsLoading(false);
           }
        catch(err){
            console.log(err);
            throw new Error("Incorrect API Request");
        }   

      },1000);


    },[])
    
  return(
          <div>
             {isLoading && <Loader/>}

             <hr/>
             <ul>
                 {data.map((datum)=>(
                     <li key= {datum.id}>
                         {datum.title}</li>

                 ))}

             </ul>
          </div>
  )
}
export default Home;
